import './App.css';
import React from 'react';
import ApplicationBar from "./menu/ApplicationBar";
import LandingCover from "./LandingCover";
import Footer from "./Footer";
import {Divider} from "@material-ui/core";
import Typography from "@material-ui/core/Typography";
import Card from "@material-ui/core/Card";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
}));

function App() {
    const classes = useStyles();
    return (
        <div>
            <ApplicationBar/>
            <LandingCover/>
            <Divider/>
            <Grid container spacing={3}>
                <Grid item xs={12}>
                    <Paper className={classes.paper}>xs=12</Paper>
                </Grid>
                <Grid item xs={12} sm={6}>
                    <Paper className={classes.paper}>xs=12 sm=6</Paper>
                </Grid>
                <Grid item xs={12} sm={6}>
                    <Paper className={classes.paper}>xs=12 sm=6</Paper>
                </Grid>
                <Grid item xs={6} sm={3}>
                    <Paper className={classes.paper}>xs=6 sm=3</Paper>
                </Grid>
                <Grid item xs={6} sm={3}>
                    <Paper className={classes.paper}>xs=6 sm=3</Paper>
                </Grid>
                <Grid item xs={6} sm={3}>
                    <Paper className={classes.paper}>xs=6 sm=3</Paper>
                </Grid>
                <Grid item xs={6} sm={3}>
                    <Paper className={classes.paper}>xs=6 sm=3</Paper>
                </Grid>
            </Grid>
            <div className="py64 ta-center">
                <h2 className="w90 mx-auto p-ff-roboto-slab-bold fs-headline2 mb24">For developers, by developers</h2>
                <div className="w64 h8 bar-pill d-block mb24 bg-orange-400 mx-auto mb16"></div>
                <div className="w90 wmx10 mx-auto"style={{display: 'flex'}}>
                    <Card className="wmx3 ta-center" style={{display: 'flex', flexDirection: 'column'}}>
                        <img className="mb16" src="https://cdn.sstatic.net/Img/home/public-qa.svg?v=d82acaa7df9f"/>
                        <h4 className="fs-title p-ff-roboto-slab mb16">Public Q&amp;A</h4>
                        <p className="mb24">Get answers to more than 16.5 million questions and give back by sharing
                            your knowledge with others.</p>
                        <a className="d-inline-block fc-white p-bg-purple d:bg-blue-600 py12 px24 bar-sm js-gps-track"
                           data-gps-track="product_homepage.for_developers.click({ product: 'FreeCommunity' })"
                           href="/questions"
                           data-ga="[&quot;home page&quot;,&quot;browse questions click&quot;,&quot;for developers section&quot;,null,null]">
                            Browse questions
                        </a>
                    </Card>
                    <Divider/>
                    <Card className="grid--cell wmx3 fs-body2 bs-md bar-lg p32 mt64 md:mt0 md:mb32 h:bs-lg">
                        <img className="mb16" src="https://cdn.sstatic.net/Img/home/jobs.svg?v=931d6c0863ee"/>
                        <h4 className="fs-title p-ff-roboto-slab mb16">Browse jobs</h4>
                        <p className="mb24">Find the right job through high quality listings and search for roles
                            based on title, technology stack, salary, location, and more.</p>
                        <a className="d-inline-block fc-white p-bg-purple d:bg-blue-600 py12 px24 bar-sm js-gps-track"
                           data-gps-track="product_homepage.for_developers.click({ product: 'Jobs' })" href="/jobs"
                           data-ga="[&quot;home page&quot;,&quot;browse jobs click&quot;,&quot;for developers section&quot;,null,null]">
                            Find a job
                        </a>
                    </Card>
                </div>
            </div>
            <Divider/>
            <Typography variant="h3">Education</Typography>
            <Divider/>
            <Footer/>
        </div>
    );
}

export default App;


